import { useParams } from 'react-router-dom';
import classes from './GlobalSheet.module.scss';
import axios from 'axios'

const Global = () => {
    
    const fetchData = async () => {
        const data = await axios.get('https://corona.lmao.ninja/v2/all?yesterday');
        setStrains(data.cases);
        setLoading(false);
    }
    return (
        <div className={classes.sheet__wrapper}>
            <table>
                <thead>
                    <td>Global cases!</td>
                </thead>
                <tbody>
                    <td>{counter}</td>
                </tbody>
            </table>
        </div>
    );
};
  
export default Global;
